function generateNewSingleData(dataArray) {
  const collectionOfData = new Array(10);
  const url = 'https://dog.ceo/api/breeds/image/random';

  Promise.all(
    collectionOfData.map(singleData => {
      let newData = {};
      fetch(url)
        .then(res => res.json())
        .then(data => {
          newData.id = dataArray.indexOf(singleData);
          newData.name = `Doggie ${newData.id}`;
          newData.imageUrl = data.message;
          newData.price = Math.floor(Math.random() * 10) + 1;
        });
    }),
  );

  return newData;
}

function generateDataCollection(dataArray) {
  for (let i = 0; i < 10; i++) {
    const newData = generateNewSingleData(i);
    console.log(newData);
    dataArray.push(newData);
    console.log(dataArray);
  }
  return dataArray;
}

export default generateDataCollection;
